column4:
Многофункциональный детектор из Германии.
Большой LCD экран с подсветкой.
Операционная память для добавления длины, площади и объема.
5 функций:
1) ультразвуковой измерение расстояния за вычетом длины, площади и объема. (Измерение в метрах и футах)
2) ищет деревянные конструкции в глубине до 38 мм;
3) ищет проводку (которая под напряжением) в глубине до 35 мм;
4) ищет металл в глубине до 24 мм;
5) лазер до 10 м и уровень для выравнивания плитки, шкафов и др.
В комплекте батарейка 9V (крона) + инструкция.
